def rus_random_text(all_text_size):

    text = ''

    while all_text_size > 0:

        if all_text_size > 20 :
            sentence_size = randint(5,15)
        elif all_text_size < 20:
            sentence_size = randint(5,10)
        else:
            sentence = all_text_size
        sentence = ''

        for i in range(sentence_size):

            if i == 0 :
                sentence = get_random_word()
            else :
                sentence += ((get_random_word()).lower())

            odds = randint(0,3)
            if i == sentence_size - 1:
                sentence += '. '
            else:
                if odds == 0:
                    sentence += ','
                else:
                    sentence += ' '

        all_text_size -= sentence_size

        text += sentence

    return text


